class BrokerTeamMember:
    def update_sql_codes(self, sql_codes):
        try:
            conn = sqlite3.connect('database.db')
            c = conn.cursor()
            c.executemany('UPDATE sql_codes SET code=?', sql_codes)
            conn.commit()
            return True
        except Error as e:
            print(e)
            return False

    def derive_fields(self, data):
        try:
            derived_data = {}
            for column in data:
                if column == 'office_code':
                    derived_data['office_name'] = self.get_office_name(column)
                elif column == 'funding_agency_code':
                    derived_data['funding_agency_name'] = self.get_funding_agency_name(column)
            return derived_data
        except Exception as e:
            print(e)
            return {}

    def get_office_name(self, office_code):
        try:
            conn = sqlite3.connect('database.db')
            c = conn.cursor()
            c.execute('SELECT office_name FROM offices WHERE office_code=?', (office_code,))
            office_name = c.fetchone()[0]
            return office_name
        except Error as e:
            print(e)
            return None


